const gridSize = 75;
const tokenBufferZoom = 0.9;// how much smaller the token should be to the grid
const defaultSceneName = 'scene_default';
const mainTagID = 'main';
const dbName = 'tabletop.explorer';
const imageAttachmentName = 'image';
const lsSceneName = "scene";

const tokenImageDocumentName = "tokens";
const mapImageDocumentName = "maps";

$(window).ready(async () => {

    let db = await initDb();

    let sceneName = defaultSceneName;
    if (window.localStorage.getItem(lsSceneName) != null) {
        sceneName = window.localStorage.getItem(lsSceneName);
    }

    let tokenImageDoc = await db.get(tokenImageDocumentName);

    let scene = await db.get(sceneName);
    let imageAtt = await db.getAttachment(mapImageDocumentName, scene.background);
    let imageUrl = URL.createObjectURL(imageAtt);
    let imageDim = await getImageDisplayDimensions(imageUrl, scene.background_zoom);

    let main = document.getElementById(mainTagID);

    main.style.backgroundImage = `url('${imageUrl}')`;
    main.style.height = `${imageDim.height}px`;
    main.style.width = `${imageDim.width}px`;

    //let globalZoom = 1; // how much to scale *everything* by (excluding ui)

    //if (window.localStorage.getItem("zoom") != null) {
    //    globalZoom = parseFloat(window.localStorage.getItem("zoom"));
    //}

    //main.style.transform = `scale(${globalZoom})`;

    for (let token of scene.tokens) {
        // check for ones that are out of bounds, 
        // could be caused by the image being updated.
        token.x = Math.min(imageDim.width - token.s, Math.max(0, token.x));
        token.y = Math.min(imageDim.height - token.s, Math.max(0, token.y));

        let tokenUrl = "";

        if (token.b && token.b.trim().length > 0) {
            let tokenAtt = await db.getAttachment(tokenImageDocumentName, token.b);
            tokenUrl = URL.createObjectURL(tokenAtt);
        }

        $(main).append(`<div class="draggable ${(tokenUrl.length > 0 ? "" : "no-image")}" 
            data-label="${token.l}" 
            data-x="${token.x}"    
            data-y="${token.y}" 
            data-s="${token.s}" 
            data-b="${token.b}"
            style="
                background-color: ${token.f};
                width: ${token.s}px;
                height: ${token.s}px;
                background-image: url('${tokenUrl}');
                transform: translate(${token.x}px, ${token.y}px);"></div>`);

    }

    //$('#dropdownZoom~ul>li>a').click((e) => {
    //    window.localStorage.setItem('zoom', $(e.target).attr('data-value'));
    //    location.reload();
    //});

    let scenes = await db.allDocs({ include_docs: true });
    for (let s of scenes.rows) {
        if (s.id == mapImageDocumentName ||
            s.id == tokenImageDocumentName ||
            s.id == sceneName) {
            continue;
        }
        $('#sceneSelectInput').append(`<option id="${s.id}">${s.doc.name}</option>`);
        $('#removeSceneInput').append(`<option id="${s.id}">${s.doc.name}</option>`);
    }

    // target elements with the "draggable" class
    interact('.draggable')
        .draggable({

            // keep the element within the area of it's parent
            modifiers: [
                interact.modifiers.restrictRect({
                    restriction: 'parent',
                    endOnly: false
                })
            ],

            // enable autoScroll
            autoScroll: true,

            listeners: {

                start(event) {
                    $(event.target).addClass("dragging");
                },

                end: async function (event) {
                    $(event.target).removeClass("dragging");
                    await saveChangesToDB();
                },

                // call this function on every dragmove event
                move(event) {
                    var target = event.target
                    // keep the dragged position in the data-x/data-y attributes
                    var x = (parseFloat(target.getAttribute('data-x')) || 0) + event.dx
                    var y = (parseFloat(target.getAttribute('data-y')) || 0) + event.dy

                    // translate the element
                    target.style.transform =
                        'translate(' + x + 'px, ' + y + 'px)'

                    // update the position attributes
                    target.setAttribute('data-x', x)
                    target.setAttribute('data-y', y)
                }

            }

        });

    $('main').on('click', '.draggable', async (e) => {
        if ($('#removeTokens').prop('checked')) {
            $(e.target).remove(); // todo: check works with children
            await saveChangesToDB();
        };
    });

    let addTokenModal = document.getElementById('addTokenModal');

    addTokenModal.addEventListener('show.bs.modal', () => {
        $('#addTokenModal form')[0].reset();
        $('#addTokenModal form #tokenColourInput').val(randomColor(50));
        $('label[for="tokenImageFile"]>.form-file-text').text('Choose file...');
    })

    $('#addToken').click(async (e) => {

        let label = $('#addTokenModal form #tokenLabelInput').val();
        let colour = $('#addTokenModal form #tokenColourInput').val();
        let number = parseInt($('#addTokenModal form #tokenNumberInput').val());
        let size = parseInt($('#addTokenModal form #tokenSizeInput').val()) * gridSize * tokenBufferZoom;

        if (label.trim() == '' || number < 1 || size < 1) {
            return false;
        }

        let imageAttachmentName = "";
        let image = "";

        if ($('#addTokenModal form #tokenImageFile').val().trim().length > 0) {
            image = await getUploadedFileContents($('#addTokenModal form #tokenImageFile'));
            if (!isFileImage(image)) {
                alert("Filetype not supported.");
                return false;
            }
            let imageType = image.split(';')[0].split(':')[1];
            let imageData = image.split(';')[1].split(',')[1];

            imageAttachmentName = uuidv4();

            tokenImageDoc = await db.get(tokenImageDocumentName);
            await db.putAttachment(tokenImageDocumentName, imageAttachmentName, tokenImageDoc._rev, imageData, imageType);
            tokenImageDoc = await db.get(tokenImageDocumentName);
            colour = "#00000000";
        }

        for (let i = 1; i <= number; i++) {
            let labelN = label;
            if (number > 1) {
                labelN = `${label} ${i}`;
            }
            $(main).append(`<div class="draggable ${(imageAttachmentName.length > 0 ? "" : "no-image")}" 
                data-x="0"
                data-y="0"
                data-s="${size}" 
                data-label="${labelN}" 
                data-b="${imageAttachmentName}"
                style="
                    background-color: ${colour};
                    width: ${size}px;
                    height: ${size}px;
                    background-image: url('${image}');
                    transform: translate(0px, 0px);"></div>`);
        }
        let modal = bootstrap.Modal.getInstance(addTokenModal);
        await modal.hide();
        await saveChangesToDB();
    });

    $('#addTokenModal form #tokenImageFile').change((e) => {
        let file = $('#addTokenModal form #tokenImageFile').val();
        if (file.includes('\\')) {
            $('label[for="tokenImageFile"]>.form-file-text').text(file.split('\\').pop());
        } else {
            $('label[for="tokenImageFile"]>.form-file-text').text('Choose file...');
        }
    });

    let changeImageModal = document.getElementById('changeImageModal');

    changeImageModal.addEventListener('show.bs.modal', () => {
        $('#changeImageModal form')[0].reset();
        $('label[for="changeImageFile"]>.form-file-text').text('Choose file...');
    })

    $('#changeImageModal form #changeImageFile').change((e) => {
        let file = $('#changeImageModal form #changeImageFile').val();
        if (file.includes('\\')) {
            $('label[for="changeImageFile"]>.form-file-text').text(file.split('\\').pop());
        } else {
            $('label[for="changeImageFile"]>.form-file-text').text('Choose file...');
        }
    });

    $('#changeImage').click(async (e) => {
        try {
            let file = $('#changeImageModal form #changeImageFile').val();
            if (file.trim() == '') {
                return false;
            }
            let image = await getUploadedFileContents($('#changeImageModal form #changeImageFile'));
            if (!isFileImage(image)) {
                alert("Filetype not supported.");
                return false;
            }
            let imageName = uuidv4();
            let imageType = image.split(';')[0].split(':')[1];
            let imageData = image.split(';')[1].split(',')[1];
            mapImageDocument = await db.get(mapImageDocumentName);
            await db.putAttachment(mapImageDocumentName, imageName, mapImageDocument._rev, imageData, imageType);
            mapImageDocument = await db.get(mapImageDocumentName);
            scene = await db.get(scene._id);
            scene.background_zoom = 1;
            scene.background = imageName;
            await db.put(scene);
            scene = await db.get(scene._id);
            await saveChangesToDB();
            location.reload();
        } catch (e) {
            alert(e.message);
        }
    });

    let changeSceneModal = document.getElementById('changeSceneModal');

    changeSceneModal.addEventListener('show.bs.modal', () => {
        $('#changeSceneModal form')[0].reset();
        $('label[for="newImageFile"]>.form-file-text').text('Choose file...');
    })

    $('#changeSceneModal form #newImageFile').change((e) => {
        let file = $('#changeSceneModal form #newImageFile').val();
        if (file.includes('\\')) {
            $('label[for="newImageFile"]>.form-file-text').text(file.split('\\').pop());
        } else {
            $('label[for="newImageFile"]>.form-file-text').text('Choose file...');
        }
    });

    $('#newScene').click(async (e) => {
        try {
            let name = $('#changeSceneModal form #newSceneNameInput').val();
            let file = $('#changeSceneModal form #newImageFile').val();
            if (file.trim() == '' || name.trim() == '') {
                return false;
            }
            let image = await getUploadedFileContents($('#changeSceneModal form #newImageFile'));
            if (!isFileImage(image)) {
                alert("Filetype not supported.");
                return false;
            }

            let sceneId = `scene-` + name.replace(/[^[:alnum:]]/g, `-`).toLowerCase();
            if (scenes.rows.some(s => s.id == sceneId)) {
                alert(`'${name}' already exists`);
                return false;
            }

            let imageName = uuidv4();
            let imageType = image.split(';')[0].split(':')[1];
            let imageData = image.split(';')[1].split(',')[1];
            mapImageDocument = await db.get(mapImageDocumentName);
            await db.putAttachment(mapImageDocumentName, imageName, mapImageDocument._rev, imageData, imageType);
            mapImageDocument = await db.get(mapImageDocumentName);
            scene = await db.get(scene._id);
            await saveChangesToDB();
            let newScene = {
                _id: sceneId,
                name: name,
                background_zoom: 1,
                background: imageName,
                tokens: []
            };
            await db.put(newScene);
            window.localStorage.setItem(lsSceneName, sceneId);
            location.reload();
        } catch (e) {
            alert(e.message);
        }
    });

    $('#changeScene').click(async (e) => {
        try {
            let id = $('#changeSceneModal form #sceneSelectInput>:selected').attr('id');
            if (id == null || id.trim().length == 0) {
                return;
            }
            await saveChangesToDB();
            window.localStorage.setItem(lsSceneName, id);
            location.reload();
        } catch (e) {
            alert(e.message);
        }
    });

    $('#removeScene').click(async (e) => {
        try {
            let id = $('#changeSceneModal form #removeSceneInput>:selected').attr('id');
            if (id == null || id.trim().length == 0) {
                return;
            }
            let sceneToRemove = scenes.rows.find(s => s.id == id);
            if (sceneToRemove == null) {
                return;
            }
            if (!confirm(`Are you sure you want to remove '${sceneToRemove.doc.name}'?`)) {
                return;
            }
            await saveChangesToDB();
            await db.remove(id, sceneToRemove.doc._rev);
            location.reload();
        } catch (e) {
            alert(e.message);
        }
    });

    let settingBackgroundSize = false;
    $('#setBackgroundSize').click(async (e) => {
        if (settingBackgroundSize) {
            try {
                // set the size and refresh
                let size = parseInt($('.resize-drag').attr('data-s'));
                let width = parseFloat($('.resize-drag').attr('data-w'));
                let height = parseFloat($('.resize-drag').attr('data-h'));
                let pixelPerGrid = Math.sqrt(width * height) / size;
                let new_zoom = gridSize / pixelPerGrid;
                scene = await db.get(scene._id);
                scene.background_zoom = new_zoom * scene.background_zoom;
                await db.put(scene);
                scene = await db.get(scene._id);
                await saveChangesToDB();
                location.reload();
            } catch (e) {
                alert(e.message);
            }
        } else {

            let returned = window.prompt("Select size of reference grid. " +
                "Please adjust the size of the square until it covers " +
                "the same area.", "3");

            if (returned == null) {
                return;
            }

            let size = parseInt(returned);

            // hide the tokens
            $('.draggable').addClass('d-none');

            // show the reference square
            $('main').append(`<div class="resize-drag" data-x="10" data-y="10" data-s="${size}" style="
                transform: translate(10px, 10px);
                width: ${gridSize}px;
                height: ${gridSize}px;
            "></div>`);

            interact('.resize-drag')
                .resizable({
                    // resize from all edges and corners
                    edges: { left: true, right: true, bottom: true, top: true },

                    listeners: {
                        move(event) {
                            let target = event.target
                            let x = (parseFloat(target.getAttribute('data-x')) || 0)
                            let y = (parseFloat(target.getAttribute('data-y')) || 0)

                            // update the element's style
                            target.style.width = event.rect.width + 'px'
                            target.style.height = event.rect.height + 'px'

                            // translate when resizing from top or left edges
                            x += event.deltaRect.left
                            y += event.deltaRect.top

                            target.style.webkitTransform = target.style.transform =
                                'translate(' + x + 'px,' + y + 'px)'

                            target.setAttribute('data-x', x)
                            target.setAttribute('data-y', y)

                            target.setAttribute('data-w', event.rect.width)
                            target.setAttribute('data-h', event.rect.height)
                        }
                    },
                    modifiers: [
                        // keep the edges inside the parent
                        interact.modifiers.restrictEdges({
                            outer: 'parent'
                        }),

                        // minimum size
                        interact.modifiers.restrictSize({
                            min: { width: 50, height: 50 }
                        })
                    ],
                })
                .draggable({
                    listeners: {
                        // call this function on every dragmove event
                        move(event) {
                            var target = event.target
                            // keep the dragged position in the data-x/data-y attributes
                            var x = (parseFloat(target.getAttribute('data-x')) || 0) + event.dx
                            var y = (parseFloat(target.getAttribute('data-y')) || 0) + event.dy

                            // translate the element
                            target.style.transform =
                                'translate(' + x + 'px, ' + y + 'px)'

                            // update the position attributes
                            target.setAttribute('data-x', x)
                            target.setAttribute('data-y', y)
                        }
                    },
                    modifiers: [
                        interact.modifiers.restrictRect({
                            restriction: 'parent',
                            endOnly: true
                        })
                    ]
                })

            settingBackgroundSize = true;
        }
    });

    async function saveChangesToDB() {
        scene.tokens = [];
        for (let r of $(main).find('.draggable')) {
            let rect = $(r);
            scene.tokens.push({
                x: rect.attr('data-x'),
                y: rect.attr('data-y'),
                s: rect.attr('data-s'),
                f: r.style.backgroundColor,
                l: rect.attr('data-label'),
                b: rect.attr('data-b')
            });
        }
        await db.put(scene);
        scene = await db.get(scene._id);
        console.log("DB updated", scene._rev);
    }

});

function isFileImage(data) {
    try {
        return data.split(';')[0].split(':')[1].split('/')[0] == 'image';
    } catch (e) {
        console.error(e);
        return false;
    }
}

function getUploadedFileContents(target) {
    return new Promise(function (resolved, rejected) {
        var files = $(target)[0].files;
        f = files[0];
        var reader = new FileReader();
        reader.onload = (e) => {
            resolved(e.target.result);
        };
        reader.onerror = rejected;
        reader.readAsDataURL(f);
    });
}

function getImageDisplayDimensions(file, zoom) {
    return new Promise(function (resolved, rejected) {
        var i = new Image();
        i.onload = function () {
            resolved({ width: i.width * zoom, height: i.height * zoom });
        };
        i.onerror = rejected;
        i.src = file;
    })
}

async function initDb() {

    let db = new PouchDB(dbName);

    let entries = await db.allDocs();

    if (entries.total_rows == 0) {

        let defaultSceneMapName = uuidv4();

        let mapImageDocument = {
            _id: mapImageDocumentName,
            _attachments: {}
        };
        mapImageDocument._attachments[defaultSceneMapName] = {
            content_type: 'image/png',
            data: ''
        }
        await db.put(mapImageDocument);

        let tokenImageDocument = {
            _id: tokenImageDocumentName,
            _attachments: {}
        };
        await db.put(tokenImageDocument);

        let defaultScene = {
            _id: defaultSceneName,
            name: 'Tavern',
            background_zoom: 1,
            background: defaultSceneMapName,
            tokens: [
                {
                    x: 50,
                    y: 50,
                    f: '#e9e9ff',
                    l: "Goblin",
                    s: gridSize * tokenBufferZoom,
                    b: ""
                }
            ]
        };

        await db.put(defaultScene);

    }

    return db;

}

//https://stackoverflow.com/a/17373688
function randomColor(brightness) {
    function randomChannel(brightness) {
        var r = 255 - brightness;
        var n = 0 | ((Math.random() * r) + brightness);
        var s = n.toString(16);
        return (s.length == 1) ? '0' + s : s;
    }
    return '#' + randomChannel(brightness) + randomChannel(brightness) + randomChannel(brightness);
}
